import styled from 'styled-components';
import logo from './logo_ReGep.png';

const Logo = styled.img`
    width: 280px;
`;

export const HeaderArea = styled.div`
    background-color: #FFF;
    height: 60px;
    border-bottom: 1px solid #CCC

    .container {
        max-width: 1000px;
        margin: auto;
        display: flex;
    }

   
`;
